import React from 'react';
import { Col, Row, Button, Typography, Space } from 'antd';
import Navbar from '../components/Navbar';

const { Title, Text } = Typography;

function Boleteria() {
  const containerStyle = {
    backgroundColor: '#fff',
    borderRadius: '8px',
    padding: '20px',
    boxShadow: '0 2px 8px rgba(0, 0, 0, 0.15)',
    width: '80%',
    maxWidth: '600px',
    margin: '0 auto',
  };

  const rectangleStyle = {
    width: '50%', // Reduce el tamaño del contenedor
    height: '50px', // Reduce la altura del contenedor
    backgroundColor: '#6c757d',
    borderRadius: '8px',
    marginBottom: '20px',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    margin: '0 auto', // Centra el rectángulo
  };

  const titleStyle = {
    color: '#fff',
    margin: 0,
    fontSize: '16px', // Reduce el tamaño de la fuente
  };

  const buttonRowStyle = {
    width: '80%',
    maxWidth: '600px',
    marginTop: '20px',
    justifyContent: 'space-between',
    margin: '20px auto 0 auto', // Centrando la fila de botones
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        backgroundImage: "url('https://via.placeholder.com/1920x1080')", // Sustituye por la URL de tu imagen
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        justifyContent: 'center',
      }}
    >
      <Row>
        <Col span={24}>
          <Navbar />
        </Col>
      </Row>

      <main style={{ flex: 1, display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
        <div style={containerStyle}>
          <div style={{ textAlign: 'center' }}>
            <div style={rectangleStyle}>
              <Title level={3} style={titleStyle}>Pantalla</Title>
            </div>

            <Space style={{ margin: '16px 0' }}>
              <div style={{ display: 'inline-block', backgroundColor: '#28a745', borderRadius: '50%', width: '10px', height: '10px' }}></div>
              <Text strong>Seleccionado</Text>
            </Space>
            <Space style={{ margin: '16px 0' }}>
              <div style={{ display: 'inline-block', backgroundColor: '#dc3545', borderRadius: '50%', width: '10px', height: '10px' }}></div>
              <Text strong>Ocupado</Text>
            </Space>

            <div style={{ margin: '20px 0' }}>
              {['A', 'B', 'C', 'D'].map(row => (
                <Row key={row} justify="center" style={{ marginBottom: '8px' }}>
                  {[1, 2, 3, 4, 5].map(seat => (
                    <Col key={`${row}${seat}`} style={{ margin: '0 4px' }}>
                      <Button type="primary" style={{ borderRadius: '4px', width: '40px', height: '40px' }}>
                        {`${row}${seat}`}
                      </Button>
                    </Col>
                  ))}
                </Row>
              ))}
            </div>
          </div>
        </div>

        {/* Botones fuera del contenedor de asientos */}
        <Row style={buttonRowStyle}>
          <Col>
            <Button href="#" type="default">Atrás</Button>
          </Col>
          <Col>
            <Button href="recibo.html" type="default">Siguiente</Button>
          </Col>
        </Row>
      </main>

      <footer style={{ backgroundColor: '#343a40', color: '#fff', textAlign: 'center', padding: '8px 16px', marginTop: '20px' }}>
        <Text>&copy; 2024. Todos los derechos reservados.</Text>
      </footer>
    </div>
  );
}

export default Boleteria;
